import React from "react";
import "./App.css";
import { BroweserRouter, Routes, Route, } from "react-router-dom";
import Layout from "./components/Layout";
function App() {
  return (
    <>
      <BrowserRouter>
         <Routes>
            <Route path="/" element={<Layout/>}>
              <Route index element={<Home />} />

            </Route>
         </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
